//itemsByCategory
import React from 'react';
//import $ from 'jquery';

export default class ItemsByCategory extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
        }

        this.name = "itemsByCategory";
        this.myApp = this.props.myParent;
        this.myParent = this.props.myParent;

        let new_myChildrens = this.myParent.state.myChildrens;
        new_myChildrens["itemsByCategory"] = this;
        this.myParent.setState({
            myChildrens: new_myChildrens
        });

    }
    componentWillMount() {

    }

    render() {
        return (
            <div>

                <div className="content_section w-clearfix">
                    <div className="top_title_group category">
                        <div className="top_title_txt category">גוף נפש ורוח</div>
                        <div className="cat_link_icon list"><img src="images/cat_ic_spirit.svg" alt="true" /></div>
                    </div>
                    <div className="item_group w-clearfix">
                        <div className="item_pict_group"><div className="item_pict_link w-inline-block"></div>
                            <div className="item_pict_infogroup">
                                <h3>האוניברסיטה הקוסמית - ערכים כמפתחות לשינוי</h3>
                                <div className="item_cat_group"><div className="item_cat_link">אחת ששומעת</div>
                                    <div className="item_cat_bullet" />
                                    <div>אליענה בן-דוד</div>
                                </div>
                            </div>
                        </div>
                        <div className="item_date_group">
                            <div>30.01.19</div>
                            <div className="item_time_group">
                                <div className="item_time">40</div>
                                <div>דקות</div>
                            </div>
                        </div>
                        <div className="item_txt">כמו שיעור יוגה, שמתחיל במדיטציה, בישיבה עם עיניים עצומות, כדי להרגע, לנשום, לחזור לעצמנו - כך בדיוק התוכנית מתחילה הפעם ומתוך המקום הממורכז, שלו.</div><div className="item_play_link">להאזנה</div>
                        <div className="item_social_group"><div className="social_link w-inline-block"><img src="images/ic_facebook.svg" alt="true" /></div>
                            <div className="social_line" /><div className="social_link w-inline-block"><img src="images/ic_twitter.svg" alt="true" /></div>
                            <div className="social_line" /><div className="social_link w-inline-block"><img src="images/ic_whatsapp.svg" alt="true" /></div></div>
                    </div>
                    <div className="item_group w-clearfix">
                        <div className="item_pict_group"><div className="item_pict_link w-inline-block" />
                            <div className="item_pict_infogroup">
                                <h3>האוניברסיטה הקוסמית - ערכים כמפתחות לשינוי</h3>
                                <div className="item_cat_group"><div className="item_cat_link">אחת ששומעת</div>
                                    <div className="item_cat_bullet" />
                                    <div>אליענה בן-דוד</div>
                                </div>
                            </div>
                        </div>
                        <div className="item_date_group">
                            <div>30.01.19</div>
                            <div className="item_time_group">
                                <div className="item_time">40</div>
                                <div>דקות</div>
                            </div>
                        </div>
                        <div className="item_txt">כמו שיעור יוגה, שמתחיל במדיטציה, בישיבה עם עיניים עצומות, כדי להרגע, לנשום, לחזור לעצמנו - כך בדיוק התוכנית מתחילה הפעם ומתוך המקום הממורכז, שלו.</div><div className="item_play_link">להאזנה</div>
                        <div className="item_social_group"><div className="social_link w-inline-block"><img src="images/ic_facebook.svg" alt="true"/></div>
                            <div className="social_line" /><div className="social_link w-inline-block"><img src="images/ic_twitter.svg" alt="true" /></div>
                            <div className="social_line" /><div className="social_link w-inline-block"><img src="images/ic_whatsapp.svg" alt="true" /></div></div>
                    </div>
                    <div className="add_button w-inline-block">
                        <div>עוד שידורים</div>
                    </div>
                </div>


            </div>
        );
    }
}
